--Inserts en la tabla factura_detalle



SELECT f.nro_factura,f.fecha_factura, c.nom_cliente, f.nro_mesa, p.nom_plato  FROM factura as f 
INNER JOIN detalle_factura as df ON f.nro_factura = df.nro_factura
INNER JOIN plato as p ON df.id_plato = p.id_plato
INNER JOIN cliente as c ON f.id_cliente = c.id_cliente
WHERE f.nro_mesa = 1 AND f.fecha_factura BETWEEN '2019-01-01' AND '2019-12-31'
ORDER BY f.nro_factura;

--Obtener el id del mesero, su nombre completo, la cantidad total de plantos vendidos y el total en ventas por cada mesero.
SELECT msro.id_mesero, msro.nom_mesero, msro.ape_mesero, SUM(df.cantidad) as cantidad_platos, SUM(p.precio_plato) as total_ventas from mesero as msro
INNER JOIN factura as f ON msro.id_mesero = f.id_mesero
INNER JOIN detalle_factura as df ON f.nro_factura = df.nro_factura
INNER JOIN plato as p ON df.id_plato = p.id_plato
GROUP BY msro.id_mesero, msro.nom_mesero, msro.ape_mesero
ORDER BY cantidad_platos DESC;

--Obtener los nombres y apellidos de los clientes que hayan consumido un valor total mayor a 500 (digitado por el usuario final)
SELECT c.nom_cliente, c.ape_cliente, SUM(p.precio_plato) as total_consumido from cliente as c
INNER JOIN factura as f ON f.id_cliente = c.id_cliente
INNER JOIN detalle_factura as df ON f.nro_factura = df.nro_factura
INNER JOIN plato as p ON df.id_plato = p.id_plato
GROUP BY c.nom_cliente, c.ape_cliente 
HAVING SUM(p.precio_plato) > 500;


--Obtener el nombre, la cantidad vendida de platos y el total en ventas de los 5 platos más vendidos en el mes de enero de 2019
SELECT p.nom_plato, SUM(df.cantidad), (p.precio_plato*SUM(df.cantidad)) as total_vendido FROM plato as p
INNER JOIN detalle_factura as df ON p.id_plato = df.id_plato
INNER JOIN factura as f ON f.nro_factura = df.nro_factura
GROUP BY p.nom_plato, p.precio_plato, f.fecha_factura
HAVING f.fecha_factura BETWEEN '2019-01-01' AND '2019-01-31'
ORDER BY total_vendido DESC LIMIT 5;
